KIP
@Regrann from @sindytri_ -  Singaraja 21 Agustus 2017. Kami adalah kelompok KIP, keluarga besar FE undiksha, dalam rangka memeriahkan Orange Party ke 5 tahun 2017, membuat kegiatan bakti sosial ke Panti Asuhan yayasan dana punia. Ini memang bukan suatu kegiatan yg besar yg dapat kami lakukan, tetapi hanya sedikit uluran tangan kami yg setidaknya mampu membuat wajah wajah mereka tersenyum bahagia, mereka merupakan keluarga kita, mereka adalah anak anak bangsa yg berhak menerima uluran tangan dari kita. Walaupun kami berbeda, tetapi mereka tetaplah saudara dalam kemanusiaan. Mereka mempunyai hak yang sama dengan kita. Hak pendidikan, hak memiliki keluarga dan hak mendapatkan kebahagiaan

